var video;
var texture;
var isPlaying = false;

function init ( event ){

	video = document.createElement('video');
	video.autoplay = true;
	video.loop = true;
	video.width	= 1920;
	video.height = 1080;
	video.src = url;
	video.load();

	// create the texture
	texture	= new THREE.Texture( video );

}

function update( event ) {

	if( video.readyState !== video.HAVE_ENOUGH_DATA )	return;
		texture.needsUpdate	= true;	

	this.material = new THREE.MeshStandardMaterial({
		map	: texture
	});
}

function rayHit( event ){

	if(isPlaying)
		video.pause();
	else
		video.play();

	isPlaying = ! isPlaying;
}


function stop ( event ) {

	video.pause();
}

