function update( event ){

	if(billboarding){

		this.quaternion.copy( camera.quaternion );

	}

}

function rayHit( event ){

	if(tween !== undefined)
    	tween.stop();

    var newPos = this.position;

	tween = new TWEEN.Tween(camera.position).to(newPos, 1300).onComplete(reactivate);
    tween.easing(TWEEN.Easing.Cubic.InOut);

    tween.start();

}

54FDD816-7DAC-4A1F-87CD-6453E99A2A68.source:
var listener = camera.getObjectByName("Listener");
var audioSource;
var isPlaying = true;

function init ( event ){

	console.log(this.name);

	audioSource = new THREE.PositionalAudio(listener);
	audioSource.load( url );
	audioSource.setRefDistance( 20 );
	audioSource.autoplay = isPlaying;
	this.add( audioSource );

}

function rayHit( event ){


	if(isPlaying)
	 	audioSource.pause();
	else
	 	audioSource.play();

	isPlaying = !isPlaying;

}


function stop ( event ) {

	audioSource.stop();
}

